import 'gregorian.dart';
import 'hijri.dart';

class Date {
  String? readable;
  String? timestamp;
  Hijri? hijri;
  Gregorian? gregorian;

  Date({this.readable, this.timestamp, this.hijri, this.gregorian});

  factory Date.(
    Map<String, dynamic> json,
  ) {
    return Date(
      readable: json['readable'] as String?,
      timestamp: json['timestamp'] as String?,
      hijri: json['hijri'] == null
          ? null
          : Hijri.(
              json['hijri'] as Map<String, dynamic>,
            ),
      gregorian: json['gregorian'] == null
          ? null
          : Gregorian.(
              json['gregorian'] as Map<String, dynamic>,
            ),
    );
  }

  Map<String, dynamic>
  () {
    return {
      'readable': readable,
      'timestamp': timestamp,
      'hijri': hijri
          ?.(),
      'gregorian': gregorian
          ?.(),
    };
  }
}
